	add("aristocracy", "{\"term\":\"aristocracy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027aristocracie\u0027 from *\u0027\u0027 () from Ancient greek (to 1453) \u0027άριστοκρατία\u0027 (the rule of the best) from \u0027ἄριστος\u0027 (best, noblest) + \u0027-κρατία\u0027 from \u0027κράτος\u0027 (power, rule)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The nobility, or the hereditary ruling clas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Government by such a class, or a state with such a governmen\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A class of people considered (not normally universally) superior to others\", \"priority\":3}]}, \"synonyms\":{}}");

	add("aristocrat", "{\"term\":\"aristocrat\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French {{m|fr|aristocrate}} (a word from the French Revolution), from {{m|fr|aristocratie}} (English {{m|en|aristocracy}}), from Ancient greek (to 1453) {{m|grc|ἄριστος||best}} (compare Old English {{m|ang|ar}}) + {{m|grc|κράτος||rule}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the aristocracy, nobility, or people of rank in a community; one of a ruling class; a noble (originally in Revolutionary France\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A proponent of aristocracy; an advocate of aristocratic government\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027: Plato (author) and Desmond Lee (translator), \u0027w:The Republic The Republic\u0027 (2nd edition, revised; Penguin Classics; ISBN 0140440488), Translator’s Introduction, pages 51 and 53\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Professor Fite, in \u0027The Platonic Legend\u0027, deprecates earlier idealization, and finds Plato to be an \u0027\u0027aristocrat\u0027\u0027, something of a snob, and the advocate of a restrictively organized society\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Plato was, as has so often been observed, temperamentally an \u0027\u0027aristocrat\u0027\u0027. And he believed that the qualities needed in his rulers were, in general, hereditary, and that given knowledge and opportunity you could deliberately breed for them\", \"priority\":5}]}, \"synonyms\":{}}");

