	add("arithmancy", "{\"term\":\"arithmancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀριθμός\u0027 (number) {{suffix||mancy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination using numbers that are the equivalent of letters of a nam\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Of this roote last spoken of [sc. astrology], springs innumerable branches; such as the knowledge of natiuities; the Chiromancie, Geomantie, Hydromantie, Arithmantie, Physiognomie: \u0026amp; a thousand others: which were much practiced, \u0026amp; holden in great reuerence by the Gentiles of olde.\u0026quot; -- \u0027King James Daemonologie, 1597\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Divination by means of numbers. The Greeks examined the number and value of the letters in the names of two combatants, and predicted that he whose name contained most letters, or letters of the greatest value, would be the victor.\u0026quot; -- \u0027Encyc. Occult, L. Spence, 1920\", \"priority\":3}]}, \"synonyms\":{}}");

